import React, { useState } from "react";
import useRandomNumber from "../radnomNumber/useRandomNumber";

const RandomFunction = () => {
  const [randomNumbers, setRandomNumbers] = useState([]); // State to store the array of random numbers
  const [randomNumber, generateRandomNumber] = useRandomNumber(0); // Custom hook to generate a random number

  const addRandomNumber = () => {
    // Add the new random number to the array of random numbers
    setRandomNumbers([...randomNumbers, randomNumber]);
  };

  return (
    <div>
      <ul>
        {randomNumbers.map((number, index) => (
          <li key={index}>{number}</li>
        ))}
      </ul>

      <button
        onClick={() => {
          generateRandomNumber();
          addRandomNumber();
        }}
      >
        Add Random Number
      </button>
    </div>
  );
};

export default RandomFunction;
